.daoyou {
  width: 80px;
  height: 18px;
  background: rgba(255, 255, 255, 0.5);
  border-radius: 5px;
  font-size: 15px;
  text-align: center;
  line-height: 18px;
  color: #6ddcf8;
  cursor: pointer;
}
.dl {
  width: 120px;
  position: relative;
  top: 100%;
  background: #060838;
  z-index: 1000;
}
.dl div {
  width: 100%;
  height: 30px;
  line-height: 30px;
  cursor: pointer;
  border-top: 1px solid #000;
}
.tuic {
  position: fixed;
  right: 20px;
  color: #6ddcf8;
  top: 5px;
}
